import  {FC} from 'react';
import Card from './Card';

const PackageSelector:FC<{title:string}> = (props) => {
    return (
       <Card>
             <h1 className={'text-[36px] p-6'}>{props.title}</h1>
           <ul>
                <li className={'text-[24px] p-6'}>2x Speakers</li>
                <li className={'text-[24px] p-6'}>2x Moving Heads</li>
                <li className={'text-[24px] p-6'}>1x Booth</li>
           </ul>
       </Card>
    );
};

export default PackageSelector;
